import "./App.css";
import Nav from "./Components/Nav/Nav";
import wellImg from "../src/public/content/well-red.png";

function App() {
  return (
    <div className="App">
      <Nav />
      <div className="landing">
        <img src={wellImg} alt="well-illustration"></img>
      </div>
    </div>
  );
}

export default App;
